--

CREATE TABLE `planilla` (
  `codPlaza` VARCHAR(15) NOT NULL,
  `tipoTrabajador` VARCHAR(50) NOT NULL,
  `subTipoTrabajador` VARCHAR(75) NOT NULL,
  `cargo` VARCHAR(75) NOT NULL,
  `situacionLaboral` VARCHAR(50) NOT NULL,
  `motivoVacante` TEXT,
  `docIdentidad` VARCHAR(8) NOT NULL,
  `CodModIE` VARCHAR(12) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Tabla planilla' ROW_FORMAT=COMPACT;

